import React from "react";
import "./Shipping.css";

export default function ShippingDelivery() {
  return (
       <div className="shipping-delivery-page">
      <h1>Shipping & Delivery</h1>
      <p>
        Learn about our shipping options, delivery timelines, and order tracking
        process.
      </p>
    </div>
  );
}
